import Foundation
import StockAPI
import StockModel
import SwiftUI

/// 다양한 기간의 가격 차트 데이터를 관리하는 서비스
@MainActor
@Observable
final class PriceChartService {

    /// 차트 데이터 캐시 (심볼별, 기간별)
    private var chartDataCache: [String: [ChartPeriod: [PriceChartData]]] = [:]

    /// 로딩 상태 (심볼별, 기간별)
    private var loadingStates: [String: [ChartPeriod: Bool]] = [:]

    /// 에러 상태 (심볼별, 기간별)
    private var errorStates: [String: [ChartPeriod: Error?]] = [:]

    /// 캐시 타임스탬프 (심볼별, 기간별)
    private var cacheTimestamps: [String: [ChartPeriod: Date]] = [:]

    /// Yahoo Finance API 클라이언트
    private let stockAPI: YahooFinanceClient

    /// 초기화
    /// - Parameter stockAPI: Yahoo Finance API 클라이언트
    init(stockAPI: YahooFinanceClient) {
        self.stockAPI = stockAPI
    }

    /// Mock 모드용 초기화 (프리뷰/테스트용)
    /// - Parameter useMockData: Mock 데이터 사용 여부
    init(useMockData: Bool = false) {
        self.stockAPI = YahooFinanceClient(useMockData: useMockData)
    }

    /// 특정 심볼과 기간의 차트 데이터 가져오기
    /// - Parameters:
    ///   - symbol: 주식 심볼
    ///   - period: 차트 기간
    /// - Returns: 차트 데이터 배열
    func getChartData(for symbol: String, period: ChartPeriod) -> [PriceChartData] {
        return chartDataCache[symbol]?[period] ?? []
    }

    /// 특정 심볼과 기간의 로딩 상태 확인
    /// - Parameters:
    ///   - symbol: 주식 심볼
    ///   - period: 차트 기간
    /// - Returns: 로딩 중이면 true
    func isLoading(for symbol: String, period: ChartPeriod) -> Bool {
        return loadingStates[symbol]?[period] ?? false
    }

    /// 특정 심볼과 기간의 에러 상태 확인
    /// - Parameters:
    ///   - symbol: 주식 심볼
    ///   - period: 차트 기간
    /// - Returns: 에러가 있으면 해당 에러, 없으면 nil
    func getError(for symbol: String, period: ChartPeriod) -> Error? {
        return errorStates[symbol]?[period] ?? nil
    }

    /// 캐시된 데이터가 유효한지 확인
    /// - Parameters:
    ///   - symbol: 주식 심볼
    ///   - period: 차트 기간
    /// - Returns: 캐시가 유효하면 true
    private func isCacheValid(for symbol: String, period: ChartPeriod) -> Bool {
        guard let timestamp = cacheTimestamps[symbol]?[period] else {
            return false
        }

        let validityDuration = ChartPeriodConfiguration.cacheValidityDuration(for: period)
        return Date().timeIntervalSince(timestamp) < validityDuration
    }

    /// 차트 데이터 로드
    /// - Parameters:
    ///   - symbol: 주식 심볼
    ///   - period: 차트 기간
    ///   - forceRefresh: 캐시 무시하고 강제 새로고침
    func loadChartData(for symbol: String, period: ChartPeriod, forceRefresh: Bool = false) async {
        // 유효한 캐시가 있고 강제 새로고침이 아닌 경우 스킵
        if !forceRefresh && isCacheValid(for: symbol, period: period) {
            return
        }

        // 이미 로딩 중인 경우 중복 요청 방지
        guard !isLoading(for: symbol, period: period) else { return }

        // 로딩 상태 설정
        setLoadingState(for: symbol, period: period, isLoading: true)
        setError(for: symbol, period: period, error: nil)

        do {
            let response = try await stockAPI.getHistory(
                symbol: symbol,
                period: period.rawValue,
                interval: period.interval,
                includePrePost: false
            )

            // 차트 데이터 처리
            let chartData = PriceChartDataProcessor.processChartData(response, for: period)

            // 캐시에 저장
            setChartData(for: symbol, period: period, data: chartData)
            setCacheTimestamp(for: symbol, period: period, timestamp: Date())

        } catch {
            // 에러는 상태로 관리, 로깅은 사용자에게 노출되지 않음
            setError(for: symbol, period: period, error: error)
            setChartData(for: symbol, period: period, data: [])
        }

        setLoadingState(for: symbol, period: period, isLoading: false)
    }

    /// 차트 데이터 설정 (내부 메서드)
    private func setChartData(for symbol: String, period: ChartPeriod, data: [PriceChartData]) {
        if chartDataCache[symbol] == nil {
            chartDataCache[symbol] = [:]
        }
        chartDataCache[symbol]?[period] = data
    }

    /// 로딩 상태 설정 (내부 메서드)
    private func setLoadingState(for symbol: String, period: ChartPeriod, isLoading: Bool) {
        if loadingStates[symbol] == nil {
            loadingStates[symbol] = [:]
        }
        loadingStates[symbol]?[period] = isLoading
    }

    /// 에러 상태 설정 (내부 메서드)
    private func setError(for symbol: String, period: ChartPeriod, error: Error?) {
        if errorStates[symbol] == nil {
            errorStates[symbol] = [:]
        }
        errorStates[symbol]?[period] = error
    }

    /// 캐시 타임스탬프 설정 (내부 메서드)
    private func setCacheTimestamp(for symbol: String, period: ChartPeriod, timestamp: Date) {
        if cacheTimestamps[symbol] == nil {
            cacheTimestamps[symbol] = [:]
        }
        cacheTimestamps[symbol]?[period] = timestamp
    }

    /// 특정 심볼의 모든 기간 데이터 프리로드
    /// - Parameter symbol: 주식 심볼
    func preloadAllPeriods(for symbol: String) async {
        await withTaskGroup(of: Void.self) { group in
            for period in ChartPeriod.allCases {
                group.addTask {
                    await self.loadChartData(for: symbol, period: period)
                }
            }
        }
    }

    /// 차트 데이터 새로고침
    /// - Parameters:
    ///   - symbol: 주식 심볼
    ///   - period: 차트 기간 (nil이면 모든 기간)
    func refreshChart(for symbol: String, period: ChartPeriod? = nil) async {
        if let period = period {
            await loadChartData(for: symbol, period: period, forceRefresh: true)
        } else {
            // 모든 기간 새로고침
            await withTaskGroup(of: Void.self) { group in
                for period in ChartPeriod.allCases {
                    group.addTask {
                        await self.loadChartData(for: symbol, period: period, forceRefresh: true)
                    }
                }
            }
        }
    }

    /// 차트 데이터 캐시 클리어
    /// - Parameters:
    ///   - symbol: 클리어할 심볼 (nil이면 전체 클리어)
    ///   - period: 클리어할 기간 (nil이면 해당 심볼의 모든 기간)
    func clearCache(for symbol: String? = nil, period: ChartPeriod? = nil) {
        if let symbol = symbol {
            if let period = period {
                // 특정 심볼, 특정 기간만 클리어
                chartDataCache[symbol]?[period] = nil
                loadingStates[symbol]?[period] = nil
                errorStates[symbol]?[period] = nil
                cacheTimestamps[symbol]?[period] = nil
            } else {
                // 특정 심볼의 모든 기간 클리어
                chartDataCache.removeValue(forKey: symbol)
                loadingStates.removeValue(forKey: symbol)
                errorStates.removeValue(forKey: symbol)
                cacheTimestamps.removeValue(forKey: symbol)
            }
        } else {
            // 전체 클리어
            chartDataCache.removeAll()
            loadingStates.removeAll()
            errorStates.removeAll()
            cacheTimestamps.removeAll()
        }
    }

    /// 성능 지표 계산
    /// - Parameters:
    ///   - symbol: 주식 심볼
    ///   - period: 차트 기간
    /// - Returns: 성능 지표 딕셔너리
    func getPerformanceMetrics(for symbol: String, period: ChartPeriod) -> [String: Double] {
        let data = getChartData(for: symbol, period: period)
        return PriceChartDataProcessor.calculatePerformanceMetrics(data)
    }
}

/// PriceChartService를 위한 Environment 확장
extension EnvironmentValues {
    @Entry var priceChartService: PriceChartService? = nil
}

import Foundation

