        case .sixMonths:
            return .dateTime.month(.abbreviated)
        case .oneYear:
            return .dateTime.year().month(.abbreviated)
        }
    }
}

/// 차트 기간 변경 관련 설정
struct ChartPeriodConfiguration {
    static let defaultPeriod: ChartPeriod = .oneWeek
    static let supportedPeriods: [ChartPeriod] = ChartPeriod.allCases

    /// 기간별 캐시 유효 시간 (초)
    static func cacheValidityDuration(for period: ChartPeriod) -> TimeInterval {
        switch period {
        case .oneDay:
            return 60 * 5    // 5분
        case .oneWeek:
            return 60 * 15   // 15분
        case .oneMonth:
            return 60 * 60   // 1시간
        case .threeMonths:
            return 60 * 60 * 2  // 2시간
        case .sixMonths:
            return 60 * 60 * 4  // 4시간
        case .oneYear:
            return 60 * 60 * 6  // 6시간
        }
    }
}

